import React from 'react';
import IncDecInput from "../UI/IncDecInput";
import "./OneNavik.css";

const OneNavik = ({name, val, setVal}) => {
    return (
        <div className={"oneNavik"}>
            <label className={"oneNavikName"}>{name + ":"}</label>
            <IncDecInput className={"oneNavikInp"} val={val} setVal={setVal}/>
        </div>
    );
};

export default OneNavik;
